import{_ as l,c as i,o as e,a}from"./app.fa011131.js";const f='{"title":"\u8F6F\u4EF6\u57FA\u672C\u6982\u5FF5","description":"","frontmatter":{},"headers":[{"level":2,"title":"\u8BA1\u7B97\u79D1\u5B66","slug":"\u8BA1\u7B97\u79D1\u5B66"},{"level":2,"title":"\u7A0B\u5E8F\u548C\u7F16\u7A0B","slug":"\u7A0B\u5E8F\u548C\u7F16\u7A0B"},{"level":2,"title":"\u7F16\u7A0B\u8BED\u8A00\u7684\u4F4E\u7EA7\u548C\u9AD8\u7EA7","slug":"\u7F16\u7A0B\u8BED\u8A00\u7684\u4F4E\u7EA7\u548C\u9AD8\u7EA7"},{"level":2,"title":"\u9AD8\u7EA7\u7F16\u7A0B\u8BED\u8A00\u901A\u7528\u8BED\u6CD5","slug":"\u9AD8\u7EA7\u7F16\u7A0B\u8BED\u8A00\u901A\u7528\u8BED\u6CD5"}],"relativePath":"FE-Language/ES/intro-1-software.md"}',t={},r=a('<h1 id="\u8F6F\u4EF6\u57FA\u672C\u6982\u5FF5" tabindex="-1">\u8F6F\u4EF6\u57FA\u672C\u6982\u5FF5 <a class="header-anchor" href="#\u8F6F\u4EF6\u57FA\u672C\u6982\u5FF5" aria-hidden="true">#</a></h1><p><div class="table-of-contents"><ul><li><a href="#\u8BA1\u7B97\u79D1\u5B66">\u8BA1\u7B97\u79D1\u5B66</a></li><li><a href="#\u7A0B\u5E8F\u548C\u7F16\u7A0B">\u7A0B\u5E8F\u548C\u7F16\u7A0B</a></li><li><a href="#\u7F16\u7A0B\u8BED\u8A00\u7684\u4F4E\u7EA7\u548C\u9AD8\u7EA7">\u7F16\u7A0B\u8BED\u8A00\u7684\u4F4E\u7EA7\u548C\u9AD8\u7EA7</a></li><li><a href="#\u9AD8\u7EA7\u7F16\u7A0B\u8BED\u8A00\u901A\u7528\u8BED\u6CD5">\u9AD8\u7EA7\u7F16\u7A0B\u8BED\u8A00\u901A\u7528\u8BED\u6CD5</a></li></ul></div></p><h2 id="\u8BA1\u7B97\u79D1\u5B66" tabindex="-1">\u8BA1\u7B97\u79D1\u5B66 <a class="header-anchor" href="#\u8BA1\u7B97\u79D1\u5B66" aria-hidden="true">#</a></h2><p>\u8BA1\u7B97\u662F\u4E00\u95E8\u81EA\u7136\u79D1\u5B66\uFF0C\u662F\u4E13\u95E8\u7814\u7A76\u4FE1\u606F\u5904\u7406\u7684\u9886\u57DF\u3002\u5B83\u4E3B\u8981\u89E3\u51B3\u95EE\u9898\u4E3B\u8981\u662F\uFF1A\u4EC0\u4E48\u662F\u4FE1\u606F\uFF0C\u4EE5\u53CA\u600E\u4E48\u7F16\u7801\u3001\u5904\u7406\u3001\u5B58\u50A8\u548C\u4F20\u8F93\u4FE1\u606F\u3002\u4FE1\u606F\u5904\u7406\u7684\u7814\u7A76\u63D0\u4F9B\u6570\u636E\u6A21\u578B\u4EE5\u4F9B\u5176\u5B83\u5B66\u79D1\u9886\u57DF\u7814\u7A76\uFF0C\u6BD4\u5982\u751F\u7269\u3001\u793E\u4F1A\u3001\u7ECF\u6D4E\u7B49\u3002</p><p>\u5728\u5904\u7406\u7E41\u6742\u4FE1\u606F\u7684\u5B9E\u8DF5\u8FC7\u7A0B\u4E2D\uFF0C\u9700\u8981\u901A\u8FC7\u5916\u90E8\u8BBE\u5907\u6765\u8F85\u52A9\u8BA1\u7B97\uFF0C\u56E0\u6B64\u4EA7\u751F\u4E86\u8BA1\u7B97\u673A\u3002\u5BF9\u4FE1\u606F\u8FDB\u884C\u63D0\u70BC\u8BA1\u7B97\u5EFA\u6A21\u7684\u8FC7\u7A0B\u4EA7\u751F\u4E86\u7A0B\u5E8F\u8BBE\u8BA1\u3002</p><p>\u8BA1\u7B97\u79D1\u5B66\u9886\u57DF\u7684\u4E94\u5927\u5B66\u79D1\uFF1A\u8BA1\u7B97\u673A\u79D1\u5B66\u3001\u8F6F\u4EF6\u5DE5\u7A0B\u3001\u8BA1\u7B97\u673A\u5DE5\u7A0B\u3001\u4FE1\u606F\u6280\u672F\u3001\u4FE1\u606F\u7CFB\u7EDF</p><ul><li>\u8BA1\u7B97\u673A\u79D1\u5B66</li></ul><p>\u8BA1\u7B97\u673A\u79D1\u5B66\u4E3B\u8981\u662F\u4E00\u7CFB\u5217\u7406\u8BBA\u548C\u5B9E\u8DF5\uFF0C\u5305\u62EC\u8BA1\u7B97\u95EE\u9898\u3001\u7B97\u6CD5\u3001\u6570\u636E\u7EC4\u7EC7\u3001\u8BED\u8A00\u3001\u667A\u80FD\u548C\u5B66\u4E60\u3002\u8BA1\u7B97\u673A\u79D1\u5B66\u5BB6\u4E3B\u8981\u5BFB\u627E\u5982\u4E0B\u95EE\u9898\u7684\u7B54\u6848\uFF0C\u5E76\u4ED8\u8BF8\u5B9E\u8DF5\uFF1A</p><ol><li>\u4EC0\u4E48\u53EF\u4EE5\u8BA1\u7B97\uFF0C\u4EC0\u4E48\u4E0D\u53EF\u4EE5\u8BA1\u7B97</li><li>\u67D0\u4E9B\u8BA1\u7B97\u53EF\u4EE5\u7528\u591A\u5FEB\u901F\u5EA6\u5B8C\u6210</li><li>\u8981\u5B8C\u6210\u67D0\u4E9B\u8BA1\u7B97\uFF0C\u9700\u8981\u4FDD\u5B58\u591A\u5C11\u4FE1\u606F</li><li>\u5982\u4F55\u9AD8\u6548\u3001\u5B89\u5168\u5730\u7F16\u7801\u3001\u5B58\u50A8\u548C\u68C0\u7D22\u4FE1\u606F</li><li>\u5982\u4F55\u8BBE\u8BA1\u4FE1\u606F\u8BA1\u7B97\u7684\u8FC7\u7A0B\uFF08\u7A0B\u5E8F\u8BBE\u8BA1\uFF09</li><li>\u8BA1\u7B97\u7406\u8BBA\u600E\u4E48\u5E2E\u52A9\u89E3\u91CA\u667A\u80FD\u548C\u610F\u8BC6</li><li>\u7B49\u7B49...</li></ol><ul><li>\u8F6F\u4EF6\u5DE5\u7A0B</li></ul><p>\u8F6F\u4EF6\u5DE5\u7A0B\u4E3B\u8981\u662F\u8BBE\u8BA1\u3001\u7EC4\u7EC7\u3001\u6784\u5EFA\u8F6F\u4EF6\u7CFB\u7EDF\u3002\u4E3B\u8981\u5173\u6CE8\u8F6F\u4EF6\u7684\u6267\u884C\u6548\u7387\u3001\u5065\u58EE\u6027\u3001\u53EF\u9760\u6027\u7B49\u3002</p><p>\u8BBE\u8BA1\u826F\u597D\u7684\u8F6F\u4EF6\u5E94\u5177\u5907\u5982\u4E0B\u7279\u70B9\uFF1A</p><ol><li>\u6B63\u786E\uFF1A \u5B8C\u5168\u6309\u7A0B\u5E8F\u6307\u4EE4\u884C\u4E8B\uFF0C\u4E0D\u51FA\u9519</li><li>\u53EF\u9760\uFF1A \u4E0D\u5D29\u6E83\uFF0C\u4E5F\u5C31\u662F\u4E0D\u4F1A\u610F\u5916\u505C\u6B62\u8FD0\u884C</li><li>\u9AD8\u6548\uFF1A \u5728\u5408\u7406\u7684\u65F6\u95F4\u5185\u5B8C\u6210\u6267\u884C\uFF0C\u800C\u4E14\u5360\u7528\u7684\u7A7A\u95F4\u4E5F\u4E0D\u591A</li><li>\u53EF\u7406\u89E3\uFF1A\u7A0B\u5E8F\u4EE3\u7801\u6613\u4E8E\u7406\u89E3</li><li>\u53EF\u91CD\u7528\uFF1A\u57FA\u4E8E\u7EC4\u4EF6\u6784\u5EFA\uFF0C\u8FD9\u4E9B\u7EC4\u4EF6\u53EF\u4EE5\u91CD\u590D\u4F7F\u7528\u5728\u5176\u5B83\u5730\u65B9</li><li>\u53EF\u6269\u5C55\uFF1A\u53EF\u4EE5\u6269\u5C55\u5904\u7406\u66F4\u5927\u529F\u80FD\u9700\u6C42\u7684\u573A\u666F\uFF0C\u800C\u6210\u672C\u589E\u52A0\u4E0D\u591A</li><li>\u53EF\u7EF4\u62A4\uFF1A\u53EF\u4EE5\u5F88\u5FEB\u9694\u79BB\u548C\u4FEE\u590D\u9519\u8BEF</li></ol><ul><li>\u8BA1\u7B97\u673A\u5DE5\u7A0B</li></ul><p>\u8BA1\u7B97\u673A\u5DE5\u7A0B\u4E13\u6CE8\u4E8E\u7535\u5B50\u548C\u6570\u5B57\u7CFB\u7EDF\uFF0C\u901A\u5E38\u503E\u5411\u7814\u7A76\u8BA1\u7B97\u673A\u786C\u4EF6\u548C\u8F6F\u4EF6</p><ul><li>\u4FE1\u606F\u6280\u672F</li></ul><p>\u4FE1\u606F\u6280\u672F\uFF08Information Technology, IT\uFF09\uFF0C\u4E13\u6CE8\u4E8E\u8BA1\u7B97\u8BBE\u65BD\u7684\u5EFA\u8BAE\u548C\u7EF4\u62A4\uFF0C\u5305\u62EC\u8BA1\u7B97\u7F51\u7EDC\u3001\u7F51\u7AD9\u3001\u6570\u636E\u5E93\u7B49\u3002</p><ul><li>\u4FE1\u606F\u7CFB\u7EDF</li></ul><p>\u4FE1\u606F\u7CFB\u7EDF\u4E3B\u8981\u5173\u6CE8\u8BA1\u7B97\u65B9\u6848\u7684\u8BBE\u8BA1\uFF0C\u5BF9\u6570\u636E\u5E93\u3001\u901A\u4FE1\u5DE5\u5177\u7B49\u8BA1\u7B97\u6280\u672F\u7814\u7A76\u8F83\u591A\u3002\u6BD4\u5982\u64CD\u4F5C\u7CFB\u7EDF\u3001\u529E\u516C\u8F6F\u4EF6\u89E3\u51B3\u65B9\u6848\u7B49\u3002</p><p>\u73B0\u4EE3\u7A0B\u5E8F\u8BBE\u8BA1\u4E0D\u5728\u4EC5\u4EC5\u53EA\u662F\u5728\u684C\u9762\u7535\u8111\u6216\u8005\u7B14\u8BB0\u672C\u7535\u8111\u4E0A\u5199\u4EE3\u7801\u4E86\uFF0C\u5F88\u591A\u5D4C\u5165\u5F0F\u8BBE\u5907\u90FD\u662F\u7F16\u7A0B\u7684\u5BF9\u8C61\uFF0C\u6BD4\u5982\u624B\u673A\u3001\u6C7D\u8F66\u7EC8\u7AEF\u3001\u5DE5\u4E1A\u673A\u68B0\u7B49\u3002</p><h2 id="\u7A0B\u5E8F\u548C\u7F16\u7A0B" tabindex="-1">\u7A0B\u5E8F\u548C\u7F16\u7A0B <a class="header-anchor" href="#\u7A0B\u5E8F\u548C\u7F16\u7A0B" aria-hidden="true">#</a></h2><p>\u4EFB\u4F55\u7A0B\u5E8F\u6700\u7EC8\u90FD\u8981\u5728\u8BA1\u7B97\u673A\uFF08\u5305\u62EC\u5404\u79CD\u7EC8\u7AEF\u7684\u5FAE\u578B\u8BA1\u7B97\u673A\uFF09\u4E0A\u6267\u884C\uFF0C\u800C\u8BA1\u7B97\u673A\u6267\u884C\u7684\u672C\u8D28\u90FD\u672A\u6539\u53D8\uFF0C\u90A3\u5C31\u662F\u8BA1\u7B97\u673A\u53EA\u80FD\u7406\u89E3\u7684\u6307\u4EE4\u548C\u6570\u636E\u3002\u6539\u53D8\u7684\u662F\u53EA\u662F\u7F16\u7A0B\u65B9\u5F0F\uFF0C\u4F7F\u7528\u66F4\u63A5\u8FD1\u4EBA\u7C7B\u7406\u89E3\u903B\u8F91\u7684\u7F16\u7A0B\u8BED\u8A00\u6765\u4E66\u5199\u4EE3\u7801\uFF0C\u4F46\u6700\u7EC8\u8FD8\u9700\u8981\u5BF9\u4EE3\u7801\u8FDB\u884C\u7F16\u8BD1\u6210\u8BA1\u7B97\u8981\u80FD\u7406\u89E3\u7684\u6307\u4EE4\u3002</p><p>\u6240\u4EE5\u7A0B\u5E8F\u5C31\u662F\u6307\u4EE4\u548C\u6570\u636E\u7684\u7EC4\u5408\uFF0C\u4EE5\u67D0\u79CD\u7F16\u7A0B\u8BED\u8A00\u7F16\u5199\u8868\u793A\u8BA1\u7B97\u8FC7\u7A0B\u7684\u4EE3\u7801\u3002</p><p>\u7F16\u7A0B\u5C31\u662F\u7F16\u5199\u6307\u4EE4\u8FDB\u884C\u6570\u636E\u8BA1\u7B97\u7684\u8FC7\u7A0B\u3002\u7F16\u7A0B\u662F\u4E00\u79CD\u6280\u80FD\uFF0C\u5B83\u540C\u6B66\u672F\u3001\u6728\u5DE5\u3001\u8DB3\u7403\u4E00\u6837\uFF0C\u9700\u8981\u957F\u65F6\u95F4\u7EC3\u4E60\u3002\u5B66\u4E60\u7F16\u7A0B\uFF0C\u4E00\u8981\u7EC3\u4E60\u57FA\u672C\u7684\u6280\u80FD\uFF0C\u4E8C\u8981\u7406\u89E3\u5927\u7684\u6982\u5FF5\u3002\u5C31\u50CF\u4EFB\u4F55\u884C\u4E1A\u7684\u5B66\u5F92\u4E00\u6837\uFF0C\u4E00\u5F00\u59CB\u5148\u89C2\u5BDF\u548C\u8BD5\u9A8C\u5DF2\u6709\u7A0B\u5E8F\uFF0C\u8FDB\u800C\u7406\u89E3\u7A0B\u5E8F\u6982\u5FF5\u3002\u8FD9\u4E2A\u5B66\u4E60\u8FC7\u7A0B\u65E2\u4E0D\u662F\u81EA\u4E0A\u800C\u4E0B\uFF08\u5148\u5B66\u6982\u5FF5\u518D\u5B9E\u8DF5\uFF09\uFF0C\u4E5F\u4E0D\u662F\u81EA\u4E0B\u800C\u4E0A\uFF08\u5148\u5B9E\u8DF5\u518D\u5B66\u6982\u5FF5\uFF09\uFF0C\u800C\u662F\u4ECE\u4E2D\u95F4\u5F00\u59CB\u5411\u4E24\u7AEF\u62D3\u5C55\u7684\u3002</p><h2 id="\u7F16\u7A0B\u8BED\u8A00\u7684\u4F4E\u7EA7\u548C\u9AD8\u7EA7" tabindex="-1">\u7F16\u7A0B\u8BED\u8A00\u7684\u4F4E\u7EA7\u548C\u9AD8\u7EA7 <a class="header-anchor" href="#\u7F16\u7A0B\u8BED\u8A00\u7684\u4F4E\u7EA7\u548C\u9AD8\u7EA7" aria-hidden="true">#</a></h2><p>\u8BA1\u7B97\u673ACPU\u8FD0\u884C\u7684\u662F\u673A\u5668\u8BED\u8A00\uFF0C\u5373\u4E8C\u8FDB\u5236\u6307\u4EE4\uFF0C\u6240\u6709\u8BED\u8A00\u7F16\u5199\u7684\u7A0B\u5E8F\u6700\u7EC8\u90FD\u8981\u7FFB\u8BD1\u6210\u4E8C\u8FDB\u5236\u4EE3\u7801\u3002</p><p>\u8D8A\u4F4E\u7EA7\u7684\u8BED\u8A00\uFF0C\u5F62\u5F0F\u4E0A\u8D8A\u63A5\u8FD1\u673A\u5668\u6307\u4EE4\uFF0C\u6C47\u7F16\u8BED\u8A00\u5C31\u662F\u4E0E\u673A\u5668\u6307\u4EE4\u4E00\u4E00\u5BF9\u5E94\u7684\u4F4E\u7EA7\u8BED\u8A00\u3002</p><p>\u8D8A\u9AD8\u7EA7\u7684\u8BED\u8A00\uFF0C\u4E00\u6761\u8BED\u53E5\u5BF9\u5E94\u7684\u6307\u4EE4\u6570\u53EF\u80FD\u5F88\u591A\uFF0C\u9AD8\u7EA7\u8BED\u8A00\u5BF9\u5E95\u5C42\u64CD\u4F5C\u8FDB\u884C\u4E86\u62BD\u8C61\u548C\u5C01\u88C5\uFF0C\u4F7F\u7F16\u5199\u7A0B\u5E8F\u7684\u8FC7\u7A0B\u66F4\u7B26\u5408\u4EBA\u7C7B\u7684\u601D\u7EF4\u4E60\u60EF\u3002\u4E5F\u5C31\u662F\u8BF4\u4F60\u7528\u9AD8\u7EA7\u8BED\u8A00\u5199\u4E00\u53E5\uFF0C\u4F1A\u88AB\u8F6C\u6362\u6210\u8BB8\u591A\u5E95\u5C42\u64CD\u4F5C\uFF0C\u5927\u90E8\u5206\u7684\u5DE5\u4F5C\u4EA4\u7ED9\u4E86\u8D1F\u8D23\u8F6C\u6362\u7684\u673A\u5668\uFF08\u5373\u7F16\u8BD1\u5668\uFF09\uFF0C\u4ECE\u800C\u4EBA\u529B\u5F97\u5230\u4E86\u89E3\u653E\u3002\u56E0\u4E3A\u673A\u5668\u5C31\u662F\u7528\u6765\u4E3A\u4EBA\u7C7B\u63D0\u4F9B\u4FBF\u5229\u7684\uFF0C\u6240\u4EE5\u8BF4\u9AD8\u7EA7\u8BED\u8A00\u7684\u51FA\u73B0\u662F\u8BA1\u7B97\u673A\u53D1\u5C55\u7684\u5FC5\u7136\u7ED3\u679C\u3002</p><p>\u4E24\u8005\u4E3B\u8981\u533A\u522B\u5C31\u5728\u53EF\u8BFB\u6027\u548C\u6267\u884C\u6548\u7387\u65B9\u9762\uFF1A</p><ul><li>\u4F4E\u7EA7\u8BED\u8A00\uFF1A\u5F00\u53D1\u6548\u7387\u4F4E\uFF0C\u6267\u884C\u6548\u7387\u9AD8\uFF0C\u5BF9\u786C\u4EF6\u7684\u53EF\u63A7\u6027\u5F3A\uFF0C\u76EE\u6807\u4EE3\u7801\u5C0F\uFF0C\u53EF\u7EF4\u62A4\u6027\u5DEE\uFF0C\u53EF\u79FB\u690D\u6027\u5DEE</li><li>\u9AD8\u7EA7\u8BED\u8A00\uFF1A\u5F00\u53D1\u6548\u7387\u9AD8\uFF0C\u6267\u884C\u6548\u7387\u4F4E\uFF0C\u5BF9\u786C\u4EF6\u7684\u53EF\u63A7\u6027\u5F31\uFF0C\u76EE\u6807\u4EE3\u7801\u5927\uFF0C\u53EF\u7EF4\u62A4\u6027\u597D\uFF0C\u53EF\u79FB\u690D\u6027\u597D</li></ul><h2 id="\u9AD8\u7EA7\u7F16\u7A0B\u8BED\u8A00\u901A\u7528\u8BED\u6CD5" tabindex="-1">\u9AD8\u7EA7\u7F16\u7A0B\u8BED\u8A00\u901A\u7528\u8BED\u6CD5 <a class="header-anchor" href="#\u9AD8\u7EA7\u7F16\u7A0B\u8BED\u8A00\u901A\u7528\u8BED\u6CD5" aria-hidden="true">#</a></h2><p>\u603B\u4F53\u6765\u8BF4\uFF0C\u6784\u6210\u7A0B\u5E8F\u6700\u91CD\u8981\u7684\u4E09\u4E2A\u90E8\u5206\u5206\u522B\u662F\uFF1A</p><ol><li>\u53D8\u91CF\uFF1A \u8868\u793A\u4E00\u6BB5\u5185\u5B58\u7A7A\u95F4\uFF0C\u7528\u6765\u5B58\u50A8\u6570\u636E\uFF0C\u4EE5\u4FBF\u7A0B\u5E8F\u4E2D\u4F7F\u7528</li><li>\u8868\u8FBE\u5F0F\uFF1A\u7528\u4E8E\u8BA1\u7B97\u5E76\u5F97\u5230\u503C</li><li>\u8BED\u53E5\uFF1A \u7528\u4E8E\u63A7\u5236\u7A0B\u5E8F\u6267\u884C</li></ol><p>\u9AD8\u7EA7\u7F16\u7A0B\u8BED\u8A00\u90FD\u6709\u4E9B\u5171\u540C\u7684\u8BED\u6CD5\u6982\u5FF5\uFF1A</p><ol><li>\u5173\u952E\u5B57\uFF1A \u7F16\u7A0B\u8BED\u8A00\u4E2D\u88AB\u8D4B\u4E88\u7279\u6B8A\u542B\u4E49\u7684\u5355\u8BCD</li><li>\u6CE8\u91CA\uFF1A \u6CE8\u89E3\u8BF4\u660E\u89E3\u91CA\u7A0B\u5E8F\u4EE3\u7801\u903B\u8F91</li><li>\u53D8\u91CF\uFF1A \u8868\u793A\u4E00\u6BB5\u5185\u5B58\u7A7A\u95F4\uFF0C\u7528\u4E8E\u5B58\u50A8\u6570\u636E</li><li>\u8FD0\u884C\u7B26\uFF1A \u8868\u793A\u6570\u636E\u8FDB\u884C\u4F55\u79CD\u8BA1\u7B97\u7684\u7B26\u53F7</li><li>\u8868\u8FBE\u5F0F\uFF1A\u7528\u4E8E\u8BA1\u7B97\u5E76\u5F97\u5230\u503C</li><li>\u8BED\u53E5\uFF1A \u7528\u4E8E\u5BF9\u7A0B\u5E8F\u8FD0\u884C\u6D41\u7A0B\u8FDB\u884C\u63A7\u5236</li><li>\u51FD\u6570\uFF1A\u7528\u4E8E\u5BF9\u529F\u80FD\u4EE3\u7801\u8FDB\u884C\u5C01\u88C5\uFF0C\u4EE5\u63D0\u9AD8\u590D\u7528\u6027</li><li>\u6570\u7EC4\uFF1A \u6570\u636E\u5BB9\u5668\uFF0C\u5BF9\u5927\u91CF\u6570\u636E\u8FDB\u884C\u5C01\u88C5\u5B58\u50A8\uFF0C\u4FBF\u4E8E\u64CD\u4F5C</li><li>\u5BF9\u8C61\uFF1A\u53EA\u8981\u57FA\u4E8E\u5BF9\u8C61\u6216\u9762\u5411\u5BF9\u8C61\u7684\u7F16\u7A0B\u8BED\u8A00\u624D\u6709\u5BF9\u8C61\u7684\u6982\u5FF5\uFF0C\u5BF9\u8C61\u5C31\u662F\u4E00\u4E2A\u5C01\u88C5\u4F53\uFF0C\u901A\u5E38\u5C01\u88C5\u4E86\u6570\u636E\u548C\u64CD\u4F5C\u6570\u636E\u7684\u65B9\u6CD5</li></ol>',35),p=[r];function o(h,n,d,s,c,u){return e(),i("div",null,p)}var v=l(t,[["render",o]]);export{f as __pageData,v as default};
